function Header() {
	return (
		<div className="header">
			<header>
				<img src="https://avatars.mds.yandex.net/i?id=aa6adb77c2d9d6a24c0fe36472742cf2-5597167-images-thumbs&n=13" alt="" className="header-img" />
				<h2>Сайт учителя географии Курская ОШ <br /> Суфияровой Людмилы Викторовны</h2>
			</header>
		</div>
	);
}

export default Header
